import React from 'react'
export default class Fetchdata extends React.Component{
    state = {
        loading: true
    };

    async componentMount(){
        const url = "https://dry-bayou-99944.herokuapp.com/profiles";
        const response =  await fetch(url);
        const data = response.json();
        console.log(data);

    }
    render(){
        return(
            <>
            <div class="container mt-5">
                <div class="row">
                    <div class="col-3"></div>
                    <div class="col-6" id="outbox">
                        <div class="row"><div class="col-4 mt-3"><p id="namep">Aryan Raj</p></div> <div class="col-4"></div><div class="col mt-3"><p id="phonep"> 09987654323</p></div></div>
                        <div class="row"><div class="col"><p id="mailp">Abc@gmail.com</p></div></div>
                        <div class="row"><div class="col mt-3 mb-3"><p id="addp"> Bihar, kjamuiokh, india 786576: sector A</p></div></div>
                    </div>
                </div>
            </div>
        </>
        )
    };
}
